import './App.css';
import React, { Component } from "react"
import Home from './components/Home'
import Town from './components/town'
class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      selectedMenu: 'a'
    }
  }

  render() {
    return (
      <div className="App">
        <h1>Hello World</h1>

        <div className="menu">
          <p className="menu-item" onClick={() => this.setState({ selectedMenu: 'a' })}>About Me</p>
          <p className="menu-item" onClick={() => this.setState({ selectedMenu: 'h' })}>Territories</p>

        </div>

        {this.state.selectedMenu === 'a' ?
          <Home/>
          :
            <Town />
        }
      </div>
    );
  }
}


export default App;
